import React from 'react';
import { Link } from 'react-router-dom';
import { restaurants } from '../data/restaurants';

const RestaurantListing = () => {
    return (
        <div className="p-4">
            <h1 className="text-xl font-bold mb-4">Available Restaurants</h1>
            <ul>
                {restaurants.map((restaurant) => (
                    <li key={restaurant.id} className="mb-2">
                        <Link to={`/menu/${restaurant.id}`} className="text-blue-500 underline">
                            {restaurant.name} - {restaurant.cuisine} Cuisine, {restaurant.location}
                        </Link>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default RestaurantListing;
